"use strict";

class Hname
{
	constructor()
	{
		this.hasCanvas = false;
		this.canvas = null;
		this.ctx = null; 
		this.w = 350;
		this.h = 150;
		this.svg = null;
		this.ns = "http://www.w3.org/2000/svg";
		this._title = $(document).find("title").text().toLowerCase();

		this.txt = null;
		this.selOne = null;
		this.selTwo = null;
	}
	
    test(){console.log("Hname.class");}
	
    loadSvg()
    {
			try
			{
				var msg = new Item().svg();
				var parser = new DOMParser();
				this.svg = parser.parseFromString(msg,"image/svg+xml");
				this.canvas = $("canvas").get(0);
				this.ctx = this.canvas.getContext("2d");
				this.svg.getElementsByTagName("text")[1].textContent = String.fromCharCode(63511).concat("רי").concat(String.fromCharCode(61488)) ;
				this.svg.getElementsByTagName("text")[0].textContent = "א@ר@י@ק";
				this.drawSvg(this.svg);   
			}
			catch(e)
			{
				console.log("loadSvg: " + e);
			}
    }
	
    getInput()
    {
			try
			{
				this.txt = $("input[title='Enter your name here']"); 
				//console.log("getInput: "+ $(this.txt).val());
			}
			catch(e)
			{
				console.log("getInput: " + e)
			}
    }

    getSelAccent()
    {
			try
			{
					var tgt = $('select').toArray();
					$.each(tgt, (index)=> 
					{
						if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Heart")
						{
							this.selOne =  $(tgt)[index];
						}	
					});
			}
			catch(e)
			{
				console.log("getAccent" + e);
			}
    }
	

    getSelAlloy()
    {
			try
			{       
				var tgt = $('select').toArray();
				$.each(tgt, (index)=> 
				{
					if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Silver")
					{
						this.selTwo =  $(tgt)[index];
					}	
				});
			}
			catch(e)
			{
				console.log("getAlloy: " + e);
			}
    }
	
	
	alloyColor(selTwo)
	{
		try
		{
			var alloy = {0:"#b4b4b4",1:"#b4b4b4", 2:"#CEB878", 3:"#EBC6C3", 4:"#a3a3a3"};
			var mask = {0:"#808080",1:"#808080",2:"#bbb100",3:"#c0aaaa",4:"#606060"};
			var _target = this.svg.getElementsByTagName("text")[1];
			_target.style.fill = alloy[selTwo];
			
			if(this.txt.value.length > 1)
			{
				let _target2 = $(this.svg).find("text")[0];
				_target2.style.fill = mask[selTwo];
			}
		}
		catch(e)
		{
			console.log("alloyColor: " + e);
		}
	}

	
	clsCanvas()
	{
		try
		{
			this.canvas = $("#canvas").get(0);
			this.ctx = this.canvas.getContext("2d");
			this.ctx.clearRect(0, 0, this.w, this.h);
		}
		catch(e)
		{
			console.log(e);
		}	
	}
		

	resetCanvas()
	{
			if($(this.txt).val() === "")
			{
					this.clsCanvas();
			}
	}

	

	textReplacer(txt)
	{
		return txt
			.replace(String.fromCharCode(1511),String.fromCharCode(1472))
			.replace(String.fromCharCode(62511),String.fromCharCode(63511))
			.replace(String.fromCharCode(61511),String.fromCharCode(61446))
			
			.replace(String.fromCharCode(1492),String.fromCharCode(1473))
			.replace(String.fromCharCode(62492),String.fromCharCode(63492))
			.replace(String.fromCharCode(61492),String.fromCharCode(61445))
			
			.replace(String.fromCharCode(1520),String.fromCharCode(1447))
			.replace(String.fromCharCode(62520),String.fromCharCode(63447))
			.replace(String.fromCharCode(61520),String.fromCharCode(61447))
			
			.replace(String.fromCharCode(1521),String.fromCharCode(1448))
			.replace(String.fromCharCode(62521),String.fromCharCode(63448))
			.replace(String.fromCharCode(61521),String.fromCharCode(61448))
			
			.replace(String.fromCharCode(1522),String.fromCharCode(1449))
			.replace(String.fromCharCode(62522),String.fromCharCode(63449))
			.replace(String.fromCharCode(61522),String.fromCharCode(61449));
	}

    textFactory(svgDoc, inputName, selectEndOne)
    {
        try 
        {
					if(typeof selectEndOne === 'undefined'){selectEndOne = 0};
					if(typeof inputName === 'undefined' || inputName === ""){inputName = "אננה"};
					//suffix map
					var SUFFIX = {0:60000 + inputName.substring(0,1).charCodeAt(0), 1:60091, 2:60040, 3:60123};

					const x = 61000;

					var regex = /[\(\)\[\]:;#@\^\|\?\",<>\!\\_=\+\*~`\.\{\}']/g;

					//inputName = inputName.split(" ").join("");
					inputName = inputName.replace(regex, "").replace(/[A-Z0-9]/gi,"");
	
					//map prefix, body, suffix
					let _a, _b, _c, _d;
					let _ma, _mb, _mc, _md;

					var maskName = inputName;
					inputName = inputName.split("").join("@");
			  
				
																							 
			
				if(inputName.substring(0,1).match(/^[\&|\-\@]/g))
				{
						return;
				}
				else if(inputName === 'Enteryournamehere')
				{
					return;
				}    
            
				_a="";
				if(inputName.length > 0 && selectEndOne === 0)
							{
									_a = String.fromCharCode(SUFFIX[selectEndOne]);
									_ma =String.fromCharCode(SUFFIX[selectEndOne]);
							}
				else if(inputName.length > 0 && selectEndOne > 0)
				{
					_a = String.fromCharCode(63) + String.fromCharCode(SUFFIX[selectEndOne]);
					_ma = String.fromCharCode(SUFFIX[selectEndOne]);
				}

				_b="";_mb="";
            if(inputName.length > 2 && selectEndOne === 0)
            {
                _b = inputName.substring(1,inputName.length-1);
                _mb = maskName.substring(1,maskName.length-1);
            }
				else if(inputName.length > 2 && selectEndOne > 0)
				{
					_b = inputName.substring(0,inputName.length-1);
									_mb = maskName.substring(0,maskName.length-1);
				}
							if(inputName.length > 1)
				{
					_c = String.fromCharCode(inputName.substring(inputName.length-1,inputName.length).charCodeAt(0) + x)+String.fromCharCode(63);
					_mc = String.fromCharCode(maskName.substring(maskName.length-1,maskName.length).charCodeAt(0) + x);
				}

				var _target = svgDoc.getElementsByTagName("text")[0];
				_target.textContent = "";
            
				var _prefix ,_body, _suffix;
				_prefix = document.createElementNS(this.ns,"tspan");
				_body = document.createElementNS(this.ns,"tspan");
				_suffix = document.createElementNS(this.ns,"tspan"); 
           
				_prefix.textContent = _a;
				_body.textContent = _b;
				_suffix.textContent = _c;
				_target.appendChild(_suffix);
				_target.appendChild(_body);
				_target.appendChild(_prefix);

				var _target2 = svgDoc.getElementsByTagName("text")[1];
				_target2.textContent = "";

				var _prefix2 ,_body2, _suffix2;
				_prefix2 = document.createElementNS(this.ns,"tspan");
				_body2 = document.createElementNS(this.ns,"tspan");
				_suffix2 = document.createElementNS(this.ns,"tspan");

				_prefix2.textContent = this.textReplacer(_ma);
				_body2.textContent = this.textReplacer(_mb);
				_suffix2.textContent = this.textReplacer(_mc);
				_target2.appendChild(_suffix2);
				_target2.appendChild(_body2);
				_target2.appendChild(_prefix2)
        } 
        catch(e) 
        {
            console.log("textFactory: " + e);
        }
    }
		
	
	
    drawSvg(svgDoc)
    {
        try 
        {
            var serializer = new XMLSerializer();
            var svgString = serializer.serializeToString(svgDoc);

            var img = new Image();
            img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString)); 

            img.onload = ()=> 
            {
                this.clsCanvas();
				//dropshadow
				this.ctx.shadowOffsetX=3;
				this.ctx.shadowOffsetY=12;
				this.ctx.shadowBlur=2;
				this.ctx.shadowColor="rgba(0,0,0,0.03)";
				//background color
				this.ctx.fillStyle="rgba(228,243,249,0.7)";
				this.ctx.fillOpacity=0.5;
				this.ctx.globalCompositeOperation = 'destination-under'
				this.ctx.fillRect(0, 0, canvas.width, canvas.height);

                this.ctx.drawImage(img, 0, 0, this.w, this.h);
            };
        } 
        catch(e) 
        {
            console.log("drawSvg: " + e);
        }
    }
	

	interactivity()
	{
		try
		{
			this.getInput()
			this.getSelAlloy();
			this.getSelAccent();
		
			this.resetCanvas();
			//update text
			this.textFactory(this.svg, $(this.txt).val(), $(this.selOne).prop("selectedIndex"));
			//update alloy
			this.alloyColor($(this.selTwo).prop("selectedIndex"));
			//paint canvas
			this.drawSvg(this.svg);
		}
		catch(e)
		{
			 console.log("interactivity: " + e);
		}
	}
	
   render()
   {           
		$(document)
			.on("keyup",$(this.txt),(evt)=>
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			})
			.bind("change",$(this.selOne),(evt)=> 
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			});
    }


	scaleCanvas()
	{
		$("#canvas").mouseenter(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					//dropshadow
					this.ctx.shadowOffsetX=3;
					this.ctx.shadowOffsetY=12;
					this.ctx.shadowBlur=2;
					this.ctx.shadowColor="rgba(0,0,0,0.03)";
					//background color
					this.ctx.fillStyle="rgba(228,243,249,0.7)";
					this.ctx.fillOpacity=0.5;
					this.ctx.globalCompositeOperation = 'destination-under'
					this.ctx.fillRect(0, 0, canvas.width, canvas.height);
					this.ctx.drawImage(img, -30, -15, this.w*1.2, this.h*1.2);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: "+e);
			}
		})
		.mouseout(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					//dropshadow
					this.ctx.shadowOffsetX=3;
					this.ctx.shadowOffsetY=12;
					this.ctx.shadowBlur=2;
					this.ctx.shadowColor="rgba(0,0,0,0.03)";
					//background color
					this.ctx.fillStyle="rgba(228,243,249,0.7)";
					this.ctx.fillOpacity=0.5;
					this.ctx.globalCompositeOperation = 'destination-under'
					this.ctx.fillRect(0, 0, canvas.width, canvas.height);
					this.ctx.drawImage(img,0 , 0, this.w, this.h);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: "+e);
			}
		});
	}

    init()
    {
			if($("#canvas").length > 0)
			{
				this.loadSvg();
				this.render();
				this.scaleCanvas();
			}
			else
			{
				console.log("No Canvas Found/Contact product.js vendor");
			}
    }
	}

class Item
{
	svg()
	{
		var hname = 
		"<svg xmlns:svg='http://www.w3.org/2000/svg' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink' width='350' height='150'>"
		.concat("<defs>")

		.concat("<style type='text/css'>@font-face")
		.concat("{")
		.concat("font-family:'wz_hname';")
		.concat("font-weight:normal;")
		.concat("font-style:normal;")
		.concat("src:url(data:application/font-woff;charset=utf-8;base64,) format('woff');")
		.concat("}")
		.concat("</style>")

		.concat("<filter id='Bevel' filterUnits='objectBoundingBox' x='-10%' y='-10%' width='150%' height='150%'>")
		.concat("<feGaussianBlur in='SourceAlpha' stdDeviation='0.2' result='blur'/>")
		.concat("<feSpecularLighting in='blur' surfaceScale='5' specularConstant='0.5' specularExponent='5' result='specOut' lighting-color='white'>")
		.concat("<fePointLight x='-5000' y='-5000' z='8000'/>")
		.concat("</feSpecularLighting>")
		.concat("<feComposite in='specOut' in2='SourceAlpha' operator='in' result='specOut2'/>")
		.concat("<feComposite in='SourceGraphic' in2='specOut2' operator='arithmetic' k1='0' k2='1' k3='1' k4='0' result='litPaint' />")
		.concat("</filter>")

		.concat("</defs>")
		.concat("<g>")

		.concat("<text id='txt1' style='font-size:25;stroke:none;text-anchor:middle;font-family:wz_hname' filter='url(#Bevel)' fill='#808080' transform='matrix(1 0 0 1 172 90)' ></text>")
		.concat("<text id='txt2' style='font-size:25;stroke:none;text-anchor:middle;font-family:wz_hname' filter='url(#Bevel)' fill='#bbb100' transform='matrix(1 0 0 1 172 90)' ></text>")

		.concat("</g>")
		.concat("</svg>");
			return hname;
	}	
}





